import React from "react";
import { NavLink } from "react-router-dom";
import { changeLocation } from "../../redux/actions/changeLocation";
import { store } from "../..";

export class Navbar extends React.Component {
  render() {

    return (
      <nav>
        <ul className="nav-list">
          <li>
            <NavLink
              to="/clothes/women"
              className={`${
                this.props.pathname === "/clothes/women" ? "active" : ""
              }`}
            >
              Women
            </NavLink>
          </li>
          <li>
            <NavLink
              to="/clothes/men"
              className={`${
                this.props.pathname === "/clothes/men" ? "active" : ""
              }`}
            >
              Men
            </NavLink>
          </li>
          <li>
            <NavLink
              to="/clothes/kids"
              className={`${
                this.props.pathname === "/clothes/kids" ? "active" : ""
              }`}
            >
              Kids
            </NavLink>
          </li>
        </ul>
      </nav>
    );
  }
}
